import React, {Component} from 'react';
import './Content.css';
import Text from '../Text/Text';
import tee from '../../tee.jpg';


class Content extends Component {
	constructor(){
    	super();
	}
	render(){
		return(
			<div id='content'>
				<img src={tee} />
				<Text />
			</div>
		)
	} 
}

export default Content;
